import React, { useEffect, useState } from 'react';
import api from '../../../utils/api';

export default function VisitorManagement() {
  const [visitors, setVisitors] = useState([]);
  const [visitorName, setVisitorName] = useState('');
  const [expectedDate, setExpectedDate] = useState('');
  const [loading, setLoading] = useState(true);
  const [adding, setAdding] = useState(false);
  const [message, setMessage] = useState('');

  useEffect(() => {
    fetchVisitors();
  }, []);

  const fetchVisitors = () => {
    setLoading(true);
    api.get('/visitors')
      .then(res => {
        // Filter visitors belonging to this resident
        const userId = JSON.parse(localStorage.getItem('livinglinkUser'))?.id;
        const filtered = res.data.filter(v => v.resident === userId);
        setVisitors(filtered);
        setLoading(false);
      })
      .catch(() => setLoading(false));
  };

  const handleAddVisitor = async (e) => {
    e.preventDefault();
    setMessage('');
    if (!visitorName || !expectedDate) {
      setMessage('Please enter visitor name and expected date');
      return;
    }
    setAdding(true);
    try {
      await api.post('/visitors', { visitorName, expectedDate });
      setMessage('Visitor added and awaiting approval.');
      setVisitorName('');
      setExpectedDate('');
      fetchVisitors();
    } catch (err) {
      setMessage(err.response?.data?.message || 'Failed to add visitor');
    }
    setAdding(false);
  };

  return (
    <div>
      <h3>Visitor Management</h3>
      <form onSubmit={handleAddVisitor} className="mb-4">
        <div className="mb-3">
          <label>Visitor Name</label>
          <input
            type="text"
            className="form-control"
            value={visitorName}
            onChange={e => setVisitorName(e.target.value)}
            required
          />
        </div>
        <div className="mb-3">
          <label>Expected Date</label>
          <input
            type="date"
            className="form-control"
            value={expectedDate}
            onChange={e => setExpectedDate(e.target.value)}
            required
          />
        </div>
        {message && <div className="mb-3 text-info">{message}</div>}
        <button className="btn btn-primary" type="submit" disabled={adding}>
          {adding ? 'Adding...' : 'Add Visitor'}
        </button>
      </form>

      <h5>Your Visitors</h5>
      {loading ? <p>Loading...</p> : (
        visitors.length === 0 ? <p>No visitors added.</p> :
          <table className="table table-striped">
            <thead>
              <tr>
                <th>Visitor Name</th>
                <th>Expected Date</th>
                <th>Approved</th>
              </tr>
            </thead>
            <tbody>
              {visitors.map(v => (
                <tr key={v._id}>
                  <td>{v.visitorName}</td>
                  <td>{new Date(v.expectedDate).toLocaleDateString()}</td>
                  <td>{v.approved ? 'Yes' : 'No'}</td>
                </tr>
              ))}
            </tbody>
          </table>
      )}
    </div>
  );
}
